            <Button onClick={this.props.logout} variant="outlined" style={{ fontWeight: '400', outline: '0'  }}>Sign out of Drive</Button>             
        )
    }
}

export default connect(mapStateToProps,  { logout })(withStyles(useStyles)(Account));
